function setSession(selectedREs) {
    var selectedTEids = [];

    selectedREs.forEach(function(str) {
        if ( !str.match(/_/gi) ) {
            selectedTEids.push(str);
        }
    });

    Session.set('ssnTEselected', selectedTEids);
}
